INSERT INTO `purposes` VALUES (1,'---\n- Officia nihil est voluptas aperiam odio quisquam.\n- Nobis laborum at ratione quidem non dolores quia.\n'),(2,'---\n- Consequatur ut sit officia.\n- Voluptas debitis aut labore.\n'),(3,'Ersatzstativ fr die Ausstellung.'),(4,'Ersatzstativ fr die Ausstellung.'),(5,'Ersatzstativ fr die Ausstellung.'),(6,'Ersatzstativ fr die Ausstellung.'),(7,'Ersatzstativ fr die Ausstellung.'),(8,'Ersatzstativ fr die Ausstellung.'),(9,'Ersatzstativ fr die Ausstellung.'),(10,'Ersatzstativ fr die Ausstellung.'),(11,'Ersatzstativ fr die Ausstellung.'),(12,'Ersatzstativ fr die Ausstellung.'),(13,'Ersatzstativ fr die Ausstellung.'),(14,'Ersatzstativ fr die Ausstellung.'),(15,'Nemo neque ipsa amet inventore esse.'),(16,'Unde error et ex qui maxime magni voluptatem.'),(17,'Consequuntur eos odit tempore.'),(18,'Debitis error consequatur facere et labore et corrupti aut.'),(19,'Non beatae repellat qui sunt qui.'),(20,'Et aperiam blanditiis molestiae aut animi velit velit.'),(21,'Bentige ich fr die Aufnahmen meiner Abschlussarbeit.'),(22,'Reiciendis nisi nihil explicabo praesentium dolores perferendis ea quia.'),(23,'Velit quibusdam deleniti et omnis quis.'),(24,'Animi ut non qui harum quia.'),(25,'Magni quo aspernatur quae at et ex odio.'),(26,'Ersatzstativ fr die Ausstellung.'),(27,'Fr das zweite Austellungswochenende.'),(28,'Fr das dritte Austellungswochenende.'),(29,'Fr die Abschlussarbeit.'),(30,'Ersatzstativ fr die Ausstellung.'),(31,'Bestellung mit Software'),(32,'Um meine Abschlussarbeit zu fotografieren.'),(33,'Velit excepturi eveniet suscipit ut ut eos aspernatur.'),(34,'Um meine Abschlussarbeit zu fotografieren.'),(35,'Um meine Abschlussarbeit zu fotografieren.'),(36,'Sunt non excepturi quia nihil maiores fugit aspernatur.'),(37,'Paketausgabe'),(38,'Fr meinen aktuellen Kurs.'),(39,'Ersatzstativ fr die Ausstellung.'),(40,'Um meine Abschlussarbeit zu fotografieren.'),(41,'Fotoshooting (Kurs Fotografie).'),(42,'Brauche ich zwingend fr meinen Kurs.'),(43,'Ganz dringend bentigt fr meine Abschlussarbeit.'),(44,'Als Ersatz.');
